import React, { useState } from "react";
import View from "../components/View";
import Dot from "../components/Dot";
import styles from '../styles/Top.module.css';

function ExamplePage() {

  const [currentSlide, setCurrentSlide] = useState(0);
  const slides = [
    { id: 1, url: 'img1.jpg' },
    { id: 2, url: 'img2.jpg' },
    { id: 3, url: 'img3.jpg' },
    { id: 4, url: 'img4.jpg' },
    { id: 5, url: 'img5.jpg' },
    { id: 6, url: 'img6.jpg' }
  ];
  const slidesToShow = 3;

  const handlePrevSlide = () => {
    setCurrentSlide(currentSlide - 1);
  };

  const handleNextSlide = () => {
    setCurrentSlide(currentSlide + 1);
  };

  return (
    <section>

      <div>
        <nav className={styles.navbar}>
          <span className={styles.navLink}>
            Contact
          </span>
          <button className={styles.loginButton}>
            <span>Login</span>
            <Dot />
          </button>
          <span className={styles.navLink}>
            Profile
          </span>
        </nav>

        <img
          src="https://via.placeholder.com/1536x864.jpg"
          alt="Example Image"
          className={styles.exampleImg}
        />
      </div>

      <div className={styles.container}>
        <img
          className={styles.image}
          src="https://via.placeholder.com/783x600.jpg"
          alt="예시 이미지"
        />
        <div className={styles.wrapper} onClick={handleClick}>
          <Dot />
          <p className={styles.tHot}>Today Hot</p>
          <p className={styles.hotName}>Ping Pong Track</p>
          <View />
          <hr />
        </div>
        <img
        src={`${process.env.PUBLIC_URL}/public_assets/vector.png`}
        className={styles.vector}
        alt='Views'
        />
      </div>
      <section>
        <div className={styles.projectTitle}>
            <Dot />
            <h3>Map</h3>
        </div>
        <div className="slide-container">
        <div className="slide-wrapper" style={{ transform: `translateX(-${currentSlide * (100 / slidesToShow)}%)` }}>
          {slides.map(slide => (
            <div key={slide.id} className="slide-item">
              <img src={slide.url} alt={`Slide ${slide.id}`} />
            </div>
          ))}
        </div>
        <button onClick={handlePrevSlide} disabled={currentSlide === 0}>Prev</button>
        <button onClick={handleNextSlide} disabled={currentSlide === slides.length - slidesToShow}>Next</button>
      </div>
      </section>


    </section>

  );
}

export default ExamplePage;
